import React, { Component } from "react";
import "./style.css";

import Input from "../components/input/Input";

class HomeWork2 extends Component {
  constructor(props) {
    super(props);
    this.state = {
      rangeValue: 1,
    };
  }
  render() {
    return (
      <div>
        <Input type="range" name="volume" min="1" max="100" step="1"></Input>
        <Input></Input>
      </div>
    );
  }
}

export default HomeWork2;
